import { Container, Row, Col } from 'react-bootstrap';

// you can access the sample dataset with:
import movieData from './movies.json'
import './App.scss'; 

function App() {
  return (
    <div className="App">
      <Container>
        <Row>
          <Col>Happy Coding!</Col>
        </Row>
      </Container>
    </div>
  );
}

export default App;
